// v0.11 Script to make a feature show lines above their head. - By Fayelure

// ------------------------OPTIONS-----------------------------------------------------
//Feel free to add liines
let textMonologue =["*LEP Is Not A Cult*","*GodJuice Available here!*","If you see my bro....","Ask him *WHERES MY HAM*"]

// Feel free to change the time between each lines
let timeBetweenLinesSaid = 2000 // in milliseconds


// -----------------------------------------------------------------------------
// Create GUI
let gui  = feature.createBasicGui()

// Add our first control:
let textControl =gui.addText(textMonologue[0])
// Call the GUI to show.
gui.show()


// loop through the text monologue lines
let k=0
setInterval(()=>{
  textControl.text = textMonologue[k]
  textControl.update()
  k++
  if(k>textMonologue.length-1){
    k=0
  }
},timeBetweenLinesSaid)

var url =["https://media-crvox.sfo2.digitaloceanspaces.com/0xe69171feff9b15daa83c0f41edcfba8994ffcd57/1636853022542-386c7e51-9fd9-4089-882d-bc44278fce31.png",
"https://media-crvox.sfo2.digitaloceanspaces.com/0xe69171feff9b15daa83c0f41edcfba8994ffcd57/1636949886010-3501f774-4fe6-47b9-9f4b-9beb49711e5c.gif"] // list of URLs

let numMilliSecs=[2500,6000] // list of numbers of milliseconds

//-----------Nothing to touch here-----------
var i=0

function newUrl(i){

  if(i!=url.length){
      feature.set({url:url[i]})
      let m =numMilliSecs[i]
      i++
      setTimeout(()=>{
                newUrl(i)
       },m)
  }else{
    i=0
    let m =numMilliSecs[i]
    setTimeout(()=>{
                newUrl(i)
    },m)
  }



}

newUrl(i)

